import logo from './logo.svg';
import { Routes, Route, Link } from "react-router-dom";
import './App.css';
import Home from './components/pages/Home';
import Astro from './components/pages/Astro';
import Current from './components/pages/Current';
import Four from './components/pages/Four';
import Nav from './components/Nav';
import Header from './components/Header';

function App() {
  return (
    <main>
    <div className="App">
      <Header/>
     <Routes>
       <Route exact path="/" element={<Home />}/>
       <Route style ={styles.btnStyle}path='home' element={<Home />}/>
       <Route path='current' element={<Current />} />
       <Route path='four' element={<Four />} />
       <Route path='astro' element={<Astro />} />
     </Routes>
    </div>
</main>
  );
}

const styles = {
  btnStyle: {
      border: '2px solid #020887',
      backgroundColor: '#1B998B',
      color: '#FBF5F3',
      fontWeight: 'bold',
      borderRadius: '10%',
      padding: '1%',
      margin: '1%',
      cursor: 'pointer',
      boxShadow:'0 3px 6px 0 rgba(0, 0, 0.20)'
  },
}

export default App;
